import React from "react";
import Note from "./Note";

const NotesList = (props) => {
    /*filter method needs a callback function */
    const keepSearchMatches = (note) => note.doesMatchSearch === true;
    const searchMatches = props.note.filter()

    /*call back function needed to map.  Need to add the key and note property inside the Note componenet*/
    const renderNote = (note) => <Note note={note} key={note.id}/>
    /*new variable to map over props.notes array and render it via the call back function*/
    const noteElements = props.notes.map(renderNote)
    
    return (
    <ul className="notes-list">
        {console.log(props.notes)}
